Boiling broccoli requires you to use a pot of water and approximately 15 minute of gas (For water to boil and cook the broccoli).. Worst is if you overcook the broccoli, WASTED!

Let's adopt technology to help us cook smarter üòÅ you only need 1/4 cup of water, a microwave and 5 minutes to get beautiful green broccoli! 

1. Take a small knife and cut broccoli from the side so it stay in almost round shape. Thereafter take a empty bowl and just fill 1/4 cup of water

2. Place your broccoli in the bowl that contain water with stem facing down

3. Cover with a bowl, microwave on high heat for 3 minutes. Let it rest for about half a minute and heat again for 2 minutes.

4. Viola! I love the bright green colour of the broccoli compared to boiling where it could turn yellowish easily.

Try it at home, it's really easy!

